import { useState } from "react";

export default function Stable(){
    
    const [urls,setUrl] = useState([]);
    const [prompt,setPrompt] = useState("");

    const { Configuration, OpenAIApi } = require("openai");
    const configuration = new Configuration({
        apiKey: "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",
    });
    const sendPrompt = async () =>{
        const openai = new OpenAIApi(configuration);
        console.log("hello");
        try{
          const response = await openai.createImage({
            prompt: "a white siamese cat",
            n: 4,
            size: "1024x1024",
          });
          const image_urls = [
            {
              idx:0,
              url:response.data.data[0].url,
            },
            {
              idx:1,
              url:response.data.data[1].url,
            },
            {
              idx:2,
              url:response.data.data[2].url,
            },
            {
              idx:3,
              url:response.data.data[3].url,
            },
            // {
            //   idx:4,
            //   url:response.data.data[4].url,
            // },
            // {
            //   idx:5,
            //   url:response.data.data[5].url,
            // },
            // {
            //   idx:6,
            //   url:response.data.data[6].url,
            // },
            // {
            //   idx:7,
            //   url:response.data.data[7].url,
            // }
          ];
          setUrl(image_urls);
          
      }
      catch(error){
        console.log(error);
      }
    }

